function call(name,data,success,async){
  $.ajax({url: "../demo/call.php",
	type: "post",
	data: {d:encck(name+";"+data)},
	async: async==undefined?true:async,
	success: function(d){
		if(d[0].charCodeAt(0)>127) d=d.substr(1); //discard charset character
		if(d=="error") alert("Error: "+d);
		else success(d.substr(0,4)=="0000" ? d.substr(4) : decck(d));
	}
  });
}

(function ($) {
    "use strict";

    /*==================================================================
    [ Validate after type ]*/
    $('.validate-input .input100').each(function(){
        $(this).on('blur', function(){
            if(validate(this) == false){
                showValidate(this);
if($(this).attr('name')=='username') $("#pass")[0].children[0].placeholder="密码 password";
return;
            }
            else {
                $(this).parent().addClass('true-validate');
            }

if($(this).attr('name')=='username'){
    var that=this;
    call("validate", encodeURIComponent($(this).val().trim())+";;;", function(d) {
		if(d!='New user'){
			$("#pass")[0].children[0].placeholder="现有用户名,请输入密码";
			$("#refer").hide();
		}
		else{
			$("#pass")[0].children[0].placeholder="新注册用户名,请输入密码";
			!QueryVar('refer')&&$("#refer").show();
		}
    });
}

if($(this).attr('name')=='refer'){
    var that=this;
    call("validate", ";;"+encodeURIComponent($(this).val().trim())+";", function(d) {
		if(d=='此推荐名不存在')showValidate(that,$(that).val()),alert(d);
    });
}

        })    
    })
  
  
    /*==================================================================
    [ Validate ]*/
    var input = $('.validate-input .input100');

    $('.validate-form').on('submit',function(){
        var check = true;

        for(var i=0; i<input.length; i++) {
            if(validate(input[i]) == false){
                showValidate(input[i]);
                check=false;
            }
        }

if(check){
    call("validate", encodeURIComponent($(input[0]).val().trim())+";"+$(input[1]).val()+";"+$(input[2]).val().trim()+";", function(d) {
		if(d.indexOf('Success')>=0){
		   var u=d.split("++");
		   localStorage.userid=u[1], localStorage.username=u[2], localStorage.refer=u[3], localStorage.refercode=u[4];
		}
		else check=false,showValidate(input[d[0]]),alert(d.substr(1));
    }, false);

}

        return check;
    });


    $('.validate-form .input100').each(function(){
        $(this).focus(function(){
           hideValidate(this);
           $(this).parent().removeClass('true-validate');
        });
    });

     function validate (input) {
        if($(input).attr('type') == 'email' || $(input).attr('name') == 'email') {
            if($(input).val().trim().match(/^([a-zA-Z0-9_\-\.]+)@((\[[0-9]{1,3}\.[0-9]{1,3}\.[0-9]{1,3}\.)|(([a-zA-Z0-9\-]+\.)+))([a-zA-Z]{1,5}|[0-9]{1,3})(\]?)$/) == null) {
                return false;
            }
        }
        else {
            if($(input)[0].parentNode.style.display=="" && $(input).val().trim() == ''){
                return false;
            }
        }
        if($(input).attr('name') == 'password') {
            if($(input).val().trim().match(/^[ -~]+$/) == null) {
                return false;
            }
        }
        if($(input).attr('name') == 'refer' && $(input)[0].parentNode.style.display=="") {
            if($(input).val().trim().match(/^\d+$/) != null) {
                return false;
            }
        }
    }

    function showValidate(input,data) {
        var thisAlert = $(input).parent();

$(thisAlert)[0].setAttribute("data-validate",data?data:$(thisAlert)[0].getAttribute("data-validate-default"));
$(thisAlert).removeClass('true-validate');

        $(thisAlert).addClass('alert-validate');

        $(thisAlert).append('<span class="btn-hide-validate">&#xf135;</span>')
        $('.btn-hide-validate').each(function(){
            $(this).on('click',function(){
               hideValidate(this);
            });
        });
    }

    function hideValidate(input) {
        var thisAlert = $(input).parent();
        $(thisAlert).removeClass('alert-validate');
        $(thisAlert).find('.btn-hide-validate').remove();
    }
    
    

})(jQuery);